  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0104394 includes underway
  - surface, meteorological, biological and physical data collected aboard the EDWIN
  LINK during cruises EL9904 and EL9905 in the North Atlantic Ocean from 1999-04-14
  to 1999-05-29. These data include WIND DIRECTION, FLUORESCENCE, LONGWAVE RADIATION
  - REFLECTED, AIR TEMPERATURE, WIND SPEED, RELATIVE HUMIDITY, SALINITY, BAROMETRIC
  PRESSURE, SHORTWAVE RADIATION - REFLECTED and SEA SURFACE TEMPERATURE. The instruments
  used to collect these data include thermosalinographs. These data were collected
  by Peter C. Smith of Bedford Institute of Oceanography, James P. Manning of National
  Marine Fisheries Service and Karen Fisher of Cornell University as part of GB. The
  Biological and Chemical Oceanography Data Management Office (BCO-DMO) submitted
  these data to NODC on 2013-01-16.nnThe following is the text of the abstract provided
  by BCO-DMO:nnEdwin Link Cruises: 9904 and 9905nShipboard meteorology and sea surface
  measurementsnalong the ship's tracknnData submitted by:nJames ManningnNational Marine
  Fisheries Service, NEFCnWoods Hole, MA 02543nnvoice: 508-495-2211nfax: 508-495-2258nemail:
  jmanning@whsun1.wh.whoi.edu (mailto:jmanning@whsun1.wh.whoi.edu)nnNote: Karen Fisher
  (Cornell Univ.) played the major role in processing our EDWIN LINK alongtrack data.
  I have simply modified and executed her Perl routines to comply with GLOBEC standards.
  Very little cleaning of the raw data was conducted (Jan 2000 Jim Manning).nLast
  modified: Sept 30, 2005; gfh w/ input from J.Manning\",\n\t\"license_title\": null,\n\t\"extras\":
